import React from 'react';
import { NavLink } from 'react-router-dom';

const Home = () => {
    return (
        <div>
            Home
            <NavLink to="/aaa">Team 1</NavLink>
            <NavLink to="/bbb">Team 2</NavLink>
            <NavLink to="/ccc">Team 3</NavLink>

        </div>
    )
}

export default Home;
